000 milliseconds\r\n    Then I click onto the button \"Odmietnuť všetky\"\r\n\r\n    Then I see hyperlink for webelements\r\n      | Kontakty                                  |\r\n      | Asistenčné služby                         |\r\n      | Pobočky KOOPERATIVA                       |\r\n      | Stav mojej škody                          |\r\n      | Postup pri poistnej udalosti              |\r\n      | Dôležité dokumenty                        |\r\n      | Online platba poistného                   |\r\n      | Prihlásenie do klientskej zóny            |\r\n      | Asistenčné služby                         |\r\n      | Prvá appka na hlásenie poistných udalostí |\r\n      | Elektronická karta PZP (zelená karta)     |\r\n\r\n    And I don´t see these texts\r\n      | Zimný denník jedného auta: Môj náročný týždeň na cestách                    |\r\n      | Pokojné Vianoce začínajú doma. Chráňte to, na čom najviac záleží            |\r\n      | Menej papiera, viac zelene: Prečo sa oplatí prejsť na digitálnu komunikáciu |\r\n\r\n    Then Inside the block \"Auto\" I see hyperlinks\r\n      | Auto                            |\r\n      | Povinné zmluvné poistenie (PZP) |\r\n      | Auto komplet                    |\r\n      | MINI KASKO                      |\r\n      | AutoMat                         |\r\n      | GAP                             |\r\n\r\n    And Inside the block \"Život\" I see hyperlinks\r\n      | Život              |\r\n      | Profi invest       |\r\n      | Moja investícia    |\r\n      | Bezstarostný život |\r\n      | Nádej              |\r\n      | Variant Kapitál    |\r\n      | Dukátik            |\r\n      | Skoré uzdravenie   |\r\n      | Silencium          |\r\n      | Vodič plus         |\r\n      | Úrazové poistenie  |\r\n      | Pripoistenia       |\r\n\r\n    And Inside the block \"Majetok\" I see hyperlinks\r\n      | Majetok            |\r\n      | Bezstarostný domov |\r\n\r\n    And Inside the block \"Zodpovednosť\" I see hyperlinks\r\n      | Zodpovednosť                                                          |\r\n      | Zodpovednosť za škodu spôsobenú zamestnávateľovi pri výkone povolania |\r\n\r\n    And Inside the block \"Cestovanie\" I see hyperlinks\r\n      | Cestovanie                                     |\r\n      | MARCO POLO                                     |\r\n      | Objavuj Slovensko                              |\r\n      | Cestovné kancelárie poistené pre prípad úpadku |\r\n\r\n    And Inside the block \"Firmy a živnostníci\" I see hyperlinks\r\n      | Firmy a živnostníci                  |\r\n      | Biznis MAX                           |\r\n      | Podnikateľ                           |\r\n      | Poistenie profesijných zodpovedností |\r\n      | Enviro max                           |\r\n\r\n    And Inside the block \"Asistenčné služby\" I see hyperlinks\r\n      | Asistenčné služby |\r\n\r\n    And Inside the block \"Bankopoistenie\" I see hyperlinks\r\n      | Bankopoistenie |\r\n\r\n    And Inside the block \"Rýchle linky\" with highlighted header I see hyperlinks\r\n      | Kontakty             |\r\n      | Pobočky a servisy    |\r\n      | Kariéra              |\r\n      | Často kladené otázky |\r\n      | Fondy                |\r\n      | Klientsky portál     |\r\n      | Investičná stratégia |\r\n\r\n    And Inside the block \"Dôležité odkazy\" with highlighted header I see hyperlinks\r\n      | Dokumenty                      |\r\n      | Ochrana osobných údajov        |\r\n      | Informácie o používaní cookies |\r\n      | Postup podávania sťažností     |\r\n      | Partneri                       |\r\n      | Whisteblowing                  |\r\n      | Konflikt záujmov               |\r\n\r\n    And Verify all links are OK\r\n\r\n  @Regression @BasicFeatures1\r\n  Scenario: Testing basic verification of fields inside request for the information form\r\n    Given I visit the main website\r\n    When I click onto webelement \"Kontakty\"\r\n    And I click onto the button \"Odmietnuť všetky\"\r\n\r\n    Then I wait for 3500 milliseconds\r\n    And I click onto the button \"Cestovanie\"\r\n    And I click onto the button \"Žiadosti\"\r\n    And I click onto the button \"Žiadosť o zmenu v poistnej zmluve\"\r\n    Then I see the following fields\r\n      | Meno                                        |\r\n      | Číslo poistnej zmluvy \/ Číslo návrhu zmluvy |\r\n      | Dátum narodenia                             |\r\n      | Priezvisko                                  |\r\n      | Email                                       |\r\n      | Telefón                                     |\r\n      | Správa                                      |\r\n\r\n    Then I do not see the following fields\r\n      | IČO               |\r\n      | Názov spoločnosti |\r\n      | Zastupujúca osoba |\r\n\r\n    And I see the text area \"Správa\"\r\n\r\n    Then I select the radiobutton \"Spoločnosť\"\r\n\r\n    Then I see the following fields\r\n      | IČO                                         |\r\n      | Číslo poistnej zmluvy \/ Číslo návrhu zmluvy |\r\n      | Názov spoločnosti                           |\r\n      | Zastupujúca osoba                           |\r\n      | Email                                       |\r\n      | Telefón                                     |\r\n      | Správa                                      |\r\n\r\n    Then I do not see the following fields\r\n      | Meno            |\r\n      | Dátum narodenia |\r\n      | Priezvisko      |\r\n\r\n    But I see the text area \"Správa\"\r\n    Then I select the radiobutton \"Fyzická osoba\"\r\n    When I type \"Alex\" into the field \"Meno\"\r\n    Then field \"Meno\" has value \"Alex\"\r\n    When I type \" \" into the field \"Meno\"\r\n    Then I see validation message \"Meno je povinný údaj\"\r\n    When I type \"Alex\" into the field \"Meno\"\r\n    Then I do not see validation message \"Meno je povinný údaj\"\r\n\r\n    When I type \"Gregor\" into the field \"Priezvisko\ ava zásielky\"\r\n        Then I see articles\r\n            | Prerušenie prevádzky    |\r\n            | Prepätie alebo podpätie |\r\n\r\n        When I click onto next slide\r\n\r\n        Then I see articles\r\n            | Cudzie veci prevzaté |\r\n            | Regresy sociálnej a zdravotných poisťovní       |\r\n            | Spätné vystúpenie vody z kanalizačného potrubia |\r\n            | Čisté finančné škody                            |\r\n\r\n        When I click onto next slide\r\n        Then I see articles\r\n            | Škody na podzemných a nadzemných vedeniach |\r\n            | Búracie práce                              |\r\n\r\n        And I click onto the article \"Búracie práce\"\r\n        Then I see these texts\r\n            | Búracie práce                                               |\r\n            | Škody spôsobené búracími a demolačnými prácami bez použitia |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.   |\r\n\r\n        And I close this dialog\r\n        Then I don´t see these texts\r\n            | Škody spôsobené búracími a demolačnými prácami bez použitia |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.   |\r\n\r\n\r\n        And I click onto the article \"Škody na podzemných a nadzemných vedeniach\"\r\n        Then I see these texts\r\n            | Škody na podzemných a nadzemných vedeniach                                                                           |\r\n            | Fyzické poškodenie nadzemného alebo podzemného vedenia, napr. vodovody, kanalizácia, plynovody, optické káble a pod. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                            |\r\n\r\n        And I close this dialog\r\n        Then I don´t see these texts\r\n            | Fyzické poškodenie nadzemného alebo podzemného vedenia, napr. vodovody, kanalizácia, plynovody, optické káble a pod. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                            |\r\n\r\n        When I click onto previous slide\r\n        And I click onto the article \"Regresy sociálnej a zdravotných poisťovní\"\r\n        Then I see these texts\r\n            | Regresy sociálnej a zdravotných poisťovní                                                                                                                |\r\n            | Pripoistenie zodpovednosti pri pracovnom úraze zamestnanca. Zahŕňa aj náhradu nákladov za zdravotnú starostlivosť, nemocenské a dôchodkové zabezpečenie. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                                                                |\r\n\r\n        And I close this dialog\r\n        Then I don´t see these texts\r\n            | Pripoistenie zodpovednosti pri pracovnom úraze zamestnanca. Zahŕňa aj náhradu nákladov za zdravotnú starostlivosť, nemocenské a dôchodkové zabezpečenie. |\r\n            | Pripoistenie si môžete zriadiť k poisteniu zodpovednosti.                                                                                                |\r\n","uri":"cypress\\e2e\\features\\Biznis-max.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Testing Business-max","description":"","children":[{"scenario":{"id":"c84efe26-6130-4a3c-8cf5-7e23ae06fce5","tags":[{"location":{"line":3,"column":5},"name":"@Regression","id":"a89f6a22-0dc2-4f91-87d8-8e97075c070c"},{"location":{"line":3,"column":17},"name":"@BusinessMax","id":"87d56e88-95f4-4e9b-ac10-21e88cb2a304"}],"location":{"line":4,"column":5},"keyword":"Scenario","name":"Verification of articles for business-max product","description":"","steps":[{"id":"b0c68902-37b3-4ccf-ba3d-52dd256bf88a","location":{"line":5,"column":9},"keyword":"Given ","keyword           | cestovanie        |\r\n            | asistencne-sluzby |\r\n\r\n        And I click onto the simple link \"zodpovednost\"\r\n        And I click onto the simple link \"zodpovednost\/skoda-sposobena-zamestnavatelovi\"\r\n        Then I see links for webelements with text\r\n            | Úvod                          |\r\n            | O poistení                    |\r\n            | Pripoistenia                  |\r\n            | Otázky a odpovede             |\r\n            | Dokumenty                     |\r\n            | Chcem poistenie zodpovednosti |\r\n\r\n        And I click onto the link of webelement with text \"Chcem poistenie zodpovednosti\"\r\n        And I click onto the button \"Odmietnuť všetky\"\r\n        Then I see following checkboxes in states\r\n            | checkbox                             | state     |\r\n            | Životné poistenie                    | unchecked |\r\n            | Poistenie bývania                    | unchecked |\r\n            | Cestovné poistenie                   | unchecked |\r\n            | Poistenie auta - PZP                 | unchecked |\r\n            | Poistenie auta - AutoMat             | unchecked |\r\n            | Iné špecifické poistenie             | unchecked |\r\n            | Oboznámil som sa s                   | unchecked |\r\n            | Poistenie zodpovednosti              | checked   |\r\n            | Podnikateľské poistenie              | unchecked |\r\n            | Poistenie do hôr                     | unchecked |\r\n            | Poistenie auta - Havarijné poistenie | unchecked |\r\n            | Poistenie auta - iné                 | unchecked |\r\n\r\n        When I type \"Alex\" into the field \"Meno\"\r\n        Then field \"Meno\" has value \"Alex\"\r\n        When I type \"\" into the field \"Meno\"\r\n        Then I see validation message \"Meno je povinný údaj\"\r\n        When I type \"Alex\" into the field \"Meno\"\r\n        Then I do not see validation message \"Meno je povinný údaj\"\r\n\r\n        When I type \"Gregor\" into the field \"Priezvisko\"\r\n        Then field \"Priezvisko\" has value \"Gregor\"\r\n        When I type \"\" into the field \"Priezvisko\"\r\n        Then I see validation message \"Priezvisko je povinný údaj\"\r\n        And I type \"Gregor\" into the field \"Priezvisko\"\r\n        Then I do not see validation message \"Priezvisko je povinný údaj\"\r\n\r\n\r\n        When I type \"test\" into the field \"Email\"\r\n        Then I see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"test@\" into the field \"Email\"\r\n        And I click away\r\n        Then I see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"test@gmail\" into the field \"Email\"\r\n        Then I see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"test@gmail.\" into the field \"Email\"\r\n        Then I see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"\" into the field \"Email\"\r\n        Then I see validation message \"Email je povinný údaj\"\r\n\r\n        When I type \"test@gmail.com\" into the field \"Email\"\r\n        Then field \"Email\" has value \"test@gmail.com\"\r\n        And I do not see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"example.name+test@gmail.com\" into the field \"Email\"\r\n        Then field \"Email\" has value \"example.name+test@gmail.com\"\r\n        And I do not see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"user123@mail.domain.com\" into the field \"Email\"\r\n        Then field \"Email\" has value \"user123@mail.domain.com\"\r\n        And I do not see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"name.surname@mail.com\" into the field \"Email\"\r\n        Then field \"Email\" has value \"name.surname@mail.com\"\r\n        And I do not see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"email_12345@gmail.io\" into the field \"Email\"\r\n        Then field \"Email\" has value \"email_12345@gmail.io\"\r\n        And I do not see validation message \"Prosím, zadajte platnú emailovú adresu\"\r\n\r\n        When I type \"\" into the field \"Telefón\"\r\n        And I see validation message \"Telefónne číslo je povinný údaj\"\r\n\r\n        When I type \"123\" into the field \"Telefón\"\r\n        Then I see validation message \"Číslo musí byť uvedené v medzinárodnom formáte a bez medzier.\"\r\n\r\n        When I type \"123456\" into the field \"Telefón\"\r\n        Then I see validation message \"Číslo musí byť uvedené v medzinárodnom formáte a bez medzier.\"\r\n\r\n        When I type \"1234567\" into the field \"Telefón\"\r\n        Then I see validation message \"Číslo musí byť uvedené v medzinárodnom formáte a bez medzier.\"\r\n\r\n        When I type \"12345678\" into the field \"Telefón\"\r\n        Then I see validation message \"Číslo musí byť uvedené v medzinárodnom formáte a bez medzier.\"\r\n\r\n        When I type \"123456789\" into the field \"Telefón\"\r\n        Then I see validation message \"Číslo musí byť uvedené v medzinárodnom formáte a bez medzier.\"\r\n\r\n        When I type \" \" into the field \"Telefón\"\r\n        Then I see validation message \"Telefónne číslo je povinný údaj\"\r\n\r\n        When I type \"323456789\" into the field \"Telefón\"\r\n        Then field \"Telefón\" has value \"+421 323 456 789\"\r\n        And I do not see validation message \"Telefónne číslo je povinný údaj\"\r\n\r\n        When I type \"987654321\" into the field \"Telefón\"\r\n        Then field \"Telefón\" has value \"+421 987 654 321\"\r\n        And I do not see validation message \"Telefónne číslo je povinný údaj\"\r\n\r\n    @Regression @ResponsibilityInsurance\r\n    Scenario: Verification of links inside responsibility insurance\r\n\r\n        Given I visit the main website\r\n        Then I wait for 1500 milliseconds\r\n        When I click onto hyperlink \"Poistenie\"\r\n        And I click onto the simple link \"zodpovednost\"\r\n        And I click onto the simple link \"zodpovednost\/skoda-sposobena-zamestnavatelovi\"\r\n        And I click onto the link of webelement with text \"Chcem poistenie zodpovednosti\"\r\n        And I click onto the button \"Odmietnuť všetky\"\r\n\r\n        Then Inside the block \"Auto\" I see hyperlinks\r\n            | Auto                            |\r\n            | Povinné zmluvné poistenie (PZP) |\r\n            | Auto komplet                    |\r\n            | MINI KASKO                      |\r\n            | AutoMat                         |\r\n            | GAP                             |\r\n\r\n        And Inside the block \"Život\" I see hyperlinks\r\n            | Život              |\r\n            | Profi invest       |\r\n            | Moja investícia    |\r\n            | Bezstarostný život |\r\n            | Nádej              |\r\n            | Variant Kapitál    |\r\n            | Dukátik            |\r\n            | Skoré uzdravenie   |\r\n            | Silencium          |\r\n            | Vodič plus         |\r\n            | Úrazové poistenie  |\r\n            | Pripoistenia       |\r\n\r\n\r\n        And Inside the block \"Majetok\" I see hyperlinks\r\n            | Majetok            |\r\n            | Bezstarostný domov |\r\n\r\n        And Inside the block \"Zodpovednosť\" I see hyperlinks\r\n            | Zodpovednosť                                                          |\r\n            | Zodpovednosť za škodu spôsobenú zamestnávateľovi pri výkone povolania |\r\n\r\n        And Inside the block \"Cestovanie\" I see hyperlinks\r\n            | Cestovanie                                     |\r\n            | MARCO POLO                                     |\r\n            | Objavuj Slovensko                              |\r\n            | Cestovné kancelárie poistené pre prípad úpadku |\r\n\r\n        And Inside the block \"Asistenčné služby\" I see hyperlinks\r\n            | Asistenčné služby |\r\n\r\n        And Inside the block \"Bankopoistenie\" I see hyperlinks\r\n            | Bankopoistenie |\r\n\r\n        And Inside the block \"Rýchle linky\" with highlighted header I see hyperlinks\r\n            | Kontakty             |\r\n            | Pobočky a servisy    |\r\n            | Kariéra              |\r\n            | Často kladené otázky |\r\n            | Fondy                |\r\n            | Klientsky portál     |\r\n            | Investičná stratégia |\r\n\r\n        And Inside the block \"Dôležité odkazy\" with highlighted header I see hyperlinks\r\n            | Dokumenty                      |\r\n            | Ochrana osobných údajov        |\r\n            | Informácie o používaní cookies |\r\n            | Postup podávania sťažností     |\r\n            | Partneri                       |\r\n            | Whisteblowing                  |\r\n            | Konflikt záujmov               |\r\n\r\n        Then I see links for webelements with text\r\n            | Zľava 10 % pre všetkých na havarijné poistenie                                                  |\r\n            | Zľava 10 % na poistenie bývania až na 3 roky a k tomu extra 20 % pre poistenie bytu na prvý rok |\r\n\r\n\r\n        Then I don’t see links for webelements with text\r\n            | Zľava 5 % na rizikové životné poistenie Bezstarostný život |\r\n\r\n","uri":"cypress\\e2e\\features\\Responsibility insurance.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Testing section responsibility insurance","description":"","children":[{"scenario":{"id":"fa035bc9-22b5-4de4-9cef-09a5c2c0ca0e","tags":[{"location":{"line":3,"column":5},"name"
